import React from 'react';
import { styled } from 'styled-components';
import { Header1 } from './styles/Headers';

function App() {
  return (
    <Wrapper>
      <Header1>Etesam Ansari</Header1>
    </Wrapper>
  );
}

const Wrapper = styled.div`
  height: 100vh;
  width: 100vw;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

export default App;
